INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('e7d7916b-1b12-45d4-9eee-ed2b8afbb656', 'f7131ea435755ea17b98dc423ead6e63', 0, 'Tobacco smoking has been associated with reduced success in the labor market, potentially due to its negative impact on labor productivity, especially in physically demanding jobs, as it affects physical fitness and performance adversely. This prospective study used data from the Cardiovascular Risk in Young Finns Study survey, linked to register information on labor market outcomes and education attainment, to examine the association between tobacco smoking and long-term labor market outcomes (earnings and employment, A one-unit increase in pack-year of smoking was associated with a 1.8% decrease in earnings (95% confidence interval [CI]: −2.6% to −0.9%) and a 0.5% reduction in years employed (95% CI: −0.6% to −0.3%).', '[0.28732502460479736,0.1424417793750763,-0.6974510550498962,0.7591067552566528,0.14184696972370148,0.17528432607650757,0.31825706362724304,0.7325157523155212,-0.3051420748233795,0.12137267738580704,0.3079957067966461,-0.3137558698654175,0.10655640065670013,-0.5020878911018372,0.11898410320281982,0.018031559884548187,1.2074134349822998,0.346855491399765,0.7875348329544067,-0.45826128125190735,0.5338154435157776,0.29921257495880127,0.1702209860086441,0.35118332505226135,-1.0166841745376587,0.07537534832954407,0.4999694228172302,-0.12416061758995056,0.261401891708374,-0.03303438425064087,0.32602885365486145,-0.4608500599861145,-0.30812326073646545,-0.02518054097890854,0.12511274218559265,0.7239536643028259,-0.35904401540756226,1.0772379636764526,-0.2483493834733963,0.30503490567207336,-0.4352927505970001,-0.2995625138282776,-0.29320666193962097,-0.6886089444160461,-0.39302337169647217,0.5369188189506531,0.7844921350479126,-0.23956820368766785,0.24165843427181244,0.10422397404909134,-0.27093079686164856,-0.04851922392845154,-0.46195074915885925,0.2665531039237976,-0.