INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('a6224462-8705-4b5d-8289-ba6790beb150', 'bda59ea2e640a63c7f95feee46aea2f1', 0, 'among the less well-educated. The finding of greater impacts on years of employment among the older age group, particularly among groups with low education levels, is consistent with the delayed onset of most health impacts, which may particularly affect productivity in physically demanding jobs that are more common among people with less education. Adverse consequences of smoking include reduced earnings and labor market participation, particularly among less well-educated groups. Tobacco control advocates should draw attention to these consequences in arguing for effective measures to reduce smoking initiation and increase cessation in order to achieve socially optimal outcomes.', '[0.8482515215873718,0.2204042673110962,-0.3211720585823059,-0.04176406189799309,0.45289427042007446,0.7629594206809998,0.0007831459515728056,0.04947975277900696,-0.3234962224960327,-0.08924533426761627,0.4264183044433594,0.28993815183639526,-0.08873792737722397,-0.8902620077133179,-0.6628404259681702,0.39722883701324463,1.4256868362426758,0.15734539926052094,0.640741765499115,-0.2793598473072052,-0.03989224135875702,0.18579357862472534,0.02425215020775795,-0.48943981528282166,-0.8803309202194214,-0.09218177199363708,0.06654925644397736,-0.11564058810472488,-1.6480553313158453e-05,-0.1623746156692505,-0.3043147623538971,0.12057702988386154,-0.41283994913101196,-0.092436283826828,-0.2321978509426117,1.154191255569458,-0.08020186424255371,0.2904360592365265,0.07067651301622391,0.09296635538339615,-1.1308331489562988,0.5712274312973022,0.16098609566688538,-0.06484588980674744,-0.669258177280426,0.30952680110931396,0.811575710773468,-0.4394835829734802,0.48541519045829773,-0.013699579052627087,-0.6902550458908081,0.5174187421798706,-0.3025415539741516,0.7684957981109619,-0.6497928500175476,0.50844007730484