INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('82966e70-70ae-413c-bfa8-2fbfbdc1937e', '39c970c99b3a4b9edc65365f540e5a2c', 0, 'Thiamine (vitamin B1) deficiency can occur secondary to malnutrition, which is associated with multiple etiologies, from imbalanced dietary habits to significant gastrointestinal nutritional losses such as recurrent vomiting or diarrhea. Thiamine deficiency manifests as dry or wet beriberi, Wernicke encephalopathy, or Korsakoff syndrome. We present a 26-year-old lady, three months post-laparoscopic sleeve gastrectomy with a complicated postoperative course due to poor oral intake and recurrent vomiting, who presented with bilateral limb weakness and vision loss of five days duration. Physical examination was significant for decreased power strength in her lower limbs relative to the upper limbs, and absent reflexes in her lower limbs.', '[0.35255613923072815,-0.8444321155548096,0.1905965656042099,-1.4824742078781128,0.3007347881793976,0.17435702681541443,0.5972831845283508,-0.7397199869155884,-0.11155108362436295,0.5318791270256042,-0.01766149513423443,0.47889941930770874,-0.28289082646369934,0.3055502772331238,-0.3325667679309845,-0.08410180360078812,-0.9239976406097412,-0.06384336203336716,-0.16973619163036346,-0.060932934284210205,-0.4392883777618408,0.7689329385757446,0.7088268995285034,0.1317148357629776,0.3367719054222107,0.2149287760257721,-0.28729358315467834,-0.6223244667053223,0.29748743772506714,-0.5579391121864319,-0.32371270656585693,0.3030465543270111,-0.733782172203064,-0.09105434268712997,-0.2510441541671753,0.7662433385848999,0.06523823738098145,0.07030501961708069,0.42818987369537354,0.14946585893630981,0.0009812250500544906,0.2877987325191498,-0.04802438244223595,0.07620886713266373,-0.1907830834388733,0.26725009083747864,-0.13918109238147736,-0.1782192885875702,0.11381860822439194,-0.49790510535240173,-0.014746573753654957,0.20516732335090637,0.2365697026252746